import React, { useState } from "react";
import "./App.css";
import CustomForm from "./components/Form/CustomForm";

function App() {
  state = {
    submitted: false,
  };

  setSubmitted = (isSubmitted) => {
    this.setState({ isSubmitted });
  };

  return (
    <>
      {!submitted && <CustomForm submitForm={setSubmitted} />}
      {submitted && <p>You submitted the form!</p>}
    </>
  );
}

export default App;
